import React, { useState } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header style={{background: '#667eea', color: 'white', padding: '2rem', textAlign: 'center'}}>
        <h1>RentalEasy</h1>
        <p>車・バイクレンタル予約サイト</p>
      </header>

      <main style={{padding: '2rem', textAlign: 'center'}}>
        <h2>サービス準備中</h2>
        <p>車両データを読み込んでいます...</p>
      </main>

      <footer style={{background: '#333', color: 'white', padding: '1rem', textAlign: 'center'}}>
        <p>&copy; 2024 RentalEasy. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
